d3.renderQueue = (function(func) {
  var _queue = [],                  // data to be rendered
      _rate = 10,                   // number of calls per frame
      _clear = function() {},       // clearing function
      _i = 0;                       // current iteration

  var rq = function(data) {
    if (data) rq.data(data);
    rq.invalidate();
    _clear();
    rq.render();
  };

  rq.render = function() {
    _i = 0;
    var valid = true;
    rq.invalidate = function() { valid = false; };

    function doFrame() {
      if (!valid) return true;
      if (_i > _queue.length) return true;

      // Typical d3 behavior is to pass a data item *and* its index. As the
      // render queue splits the original data set, we'll have to be slightly
      // more carefull about passing the correct index with the data item.
      var end = Math.min(_i + _rate, _queue.length);
      for (var i = _i; i < end; i++) {
        func(_queue[i], i);
      }
      _i += _rate;
    }

    d3.timer(doFrame);
  };

  rq.data = function(data) {
    rq.invalidate();
    _queue = data.slice(0);
    return rq;
  };

  rq.rate = function(value) {
    if (!arguments.length) return _rate;
    _rate = value;
    return rq;
  };

  rq.remaining = function() {
    return _queue.length - _i;
  };

  // clear the canvas
  rq.clear = function(func) {
    if (!arguments.length) {
      _clear();
      return rq;
    }
    _clear = func;
    return rq;
  };

  rq.invalidate = function() {};

  return rq;
});

d3.divgrid = function(config) {
  var columns = [];

  var dg = function(selection) {
    if (columns.length == 0) columns = d3.keys(selection.data()[0][0]);

    // header
    selection.selectAll(".header")
        .data([true])
      .enter().append("div")
        .attr("class", "header")

    var header = selection.select(".header")
      .selectAll(".cell")
      .data(columns);

    header.enter().append("div")
      .attr("class", function(d,i) { return "col-" + i; })
      .classed("cell", true)

    selection.selectAll(".header .cell")
      .text(function(d) { return d; });

    header.exit().remove();

    // rows
    var rows = selection.selectAll(".row")
        .data(function(d) { return d; })

    rows.enter().append("div")
        .attr("class", "row")

    rows.exit().remove();

    var cells = selection.selectAll(".row").selectAll(".cell")
        .data(function(d) { return columns.map(function(col){return d[col];}) })

    // cells
    cells.enter().append("div")
      .attr("class", function(d,i) { return "col-" + i; })
      .classed("cell", true)

    cells.exit().remove();

    selection.selectAll(".cell")
      .text(function(d) { return d; });

    return dg;
  };

  dg.columns = function(_) {
    if (!arguments.length) return columns;
    columns = _;
    return this;
  };

  return dg;
};

function drawParallelCoordinates(data) {
  var green_to_blue = d3.scale.linear()
    .domain([9, 50])
    .range(["#7AC143", "#00B0DD"])
    .interpolate(d3.interpolateLab);

  var color = function(d) { return green_to_blue(d['G']); };

  var parcoords = d3.parcoords()("#example")
    .color(color)
    .alpha(0.4);

    parcoords
      .data(data)
      .render()
      .brushMode("1D-axes");  // enable brushing

    // create data table, row hover highlighting
    var grid = d3.divgrid();
    d3.select("#grid")
      .datum(data)//.slice(0,10))
      .call(grid)
      .selectAll(".row")
      .on({
        "mouseover": function(d) { parcoords.highlight([d]) },
        "mouseout": parcoords.unhighlight
      });

    // update data table on brush event
    parcoords.on("brush", function(d) {
      d3.select("#grid")
        .datum(d)//.slice(0,10))
        .call(grid)
        .selectAll(".row")
        .on({
          "mouseover": function(d) { parcoords.highlight([d]) },
          "mouseout": parcoords.unhighlight
        });
    });
}

function listPlayers(path, filterstring) {
    return new Promise(function(resolve, reject) {
        d3.csv(path, function(data) {
          if (filterstring  !== "Batters" && filterstring  !== "Pitchers"){
            var a = _.filter(data, {
                Pos: filterstring
            })

            resolve(selectRows(a))

          }else{
            resolve(selectRows(data));
          }
        })
    }).catch(function(err) {
        console.log(err);
    });;
}

function displayTableData(dataObject, s) {
    return new Promise(function(resolve, reject) {
        var colhs = Object.keys(dataObject[0]);

        var hotElement = document.querySelector(s);
        var hotElementContainer = hotElement.parentNode;
        var hotSettings = {
            data: dataObject,
            stretchH: 'all',
            autoWrapRow: true,
            height: 150,
            width: 500,
            rowHeaders: true,
            colHeaders: colhs,
            dropdownMenu: true,
            filters: true
        };

        var hot = new Handsontable(hotElement, hotSettings);
        resolve(hot)
    }).catch(function(err) {
        console.log(err);
    });
}


function fileRouting(str) {
    if (str == "Pitchers") {
        return window.fileDecision = "pitchers.csv"
    } else {
        return window.fileDecision = "batters.csv"
    }
}

function selectRows(data){
  return new Promise(function(resolve, reject){
    var o = ['Team', 'Pos']
    var a = _.map(data, function(tem){ return _.omitBy(tem, function(v,key){ return o.includes(key) }) })
    resolve(a)
  })
}

$(document).ready(function() {

    var fileDecision = '';

    $(".position-selection-button").click(function() {
        $(".btn-group-justified button").removeClass("active");

        $("#example").empty()
        $(".empty-graph").remove()

        $(this).addClass("active");
        var lplayer = $(this).text();
        window.fileDecision = fileRouting(lplayer)

        listPlayers(
            'dist/data/' + window.fileDecision,
            lplayer
        ).then(function(stats) {
            drawParallelCoordinates(stats)

        }).catch(function(err) {
            console.log(err);
        });

        $(".teams").show();
    });
});
